using System;
using System.Collections.Generic;

namespace ConsoleApplication
{
    internal class Program
    {
        private enum Direction
        {
            Up,
            Down,
            Left,
            Right
        }


        private static string[,] _keypad = new string[5, 5]
        {
            {"?", "?", "1", "?", "?"},
            {"?", "2", "3", "4", "?"},
            {"5", "6", "7", "8", "9"},
            {"?", "A", "B", "C", "?"},
            {"?", "?", "D", "?", "?"},
        };

        public static void Main(string[] args)
        {
            var input = @"



";
            var x = 0;
            var y = 2;

            var lines = input.Split(Environment.NewLine.ToCharArray());
            foreach (var line in lines)
            {
                foreach (var c in line)
                {
                    var t = AttemptMove(c, x, y);
                    x = t.Item1;
                    y = t.Item2;
                }
                Console.Write(GetNumberAtIndex(x, y));
            }

        }

        private static Tuple<int, int> AttemptMove(char c, int x, int y)
        {
            var oldX = x;
            var oldY = y;
            if (c == 'U')
                y--;
            if (c == 'D')
                y++;
            if (c == 'L')
                x--;
            if (c == 'R')
                x++;


            if (x > 4 || y > 4 || x < 0 || y < 0 || _keypad[x, y] == "?")
            {
                return Tuple.Create(oldX, oldY);
            }
            else
            {
                return Tuple.Create(x, y);
            }
        }

        private static string GetNumberAtIndex(int x, int y)
        {
            return _keypad[y, x];
        }

    }
}